import React from 'react';

export default function Resume() {
    return (
        <div className='resume'>
            <h1 className='resume_title'><a href='https://drive.google.com/file/d/18GAoPt1vuTPsigcOHWw8F0AJpJ0bAaSm/view?usp=sharing'>Resume</a></h1>
            <div className='resume_pdf'>

                <div className='resume_text'>
                    <h5>Throughout my career, I have created and developed great applications with my training from the University of Central Florida.
                        Couple my training with my passion for learning and my consistent growth as a leader, I can work well with any team that I placed on to get tasks completed.
                    </h5>
                </div>
            </div>
            </div>
            );
}
